SUPER DUTY MURAL JAM ALERT

The gang's coming together to repaint and plaster our precious mural grounds AUG 5-7 in collaboration with @vanmuralfest We're shutting down the alley for the most concentrated mural and street art event of the Summer! 

_

Astro Alley, a new festival addition, is taking place on the grounds behind Astro Studio, 163 West 4th, where VMF was partly founded. Astro Studio has grown to be an artist collective of 20, primarily VMF alumni.

A hotbed for street art and graffiti mural production, Astro Alley has historically been one of the last spots in the city artists can create murals and street art unhindered, uninterrupted, without outside influence. It has long been used as a testing ground for this collective and friends, and will now be completely repainted for the public. 

Situated between Columbia and Manitoba, this block is a bubble of creative freedom at the heart of a rapidly changing neighbourhood. 

Join us for a new iteration of one of Vancouver’s best-kept street art secrets and the accompanying group exhibition at the front garage space at163 West 3rd.

